const Layout3 = () => {
  return (
    <div>
      <div class="container center">
      <div className="item">
        Thích tớ chứ gì!@@ 
      </div>
     <img src="/hiep.jpg" alt="hiep" width= {350} height={350} />
      </div>
    </div>
  );
};
export default React.memo(Layout3);
